const Room = new Map([
    ['basketballHall', 'Баскетбольный зал'],
    ['swimmingPool', 'Бассейн'],
    ['vipLounge', 'VIP-ложа'],
    ['someRoom', 'Комната']
]);

const TypeOfEvent = {
    PARTY: '',
    CONCERT: '',
    SPORTS_MATCH: '',
    SPORTS_TRAINING: '',
    OTHER: ''
};

export {Room, TypeOfEvent}
